import axios from 'axios';
import { Route, Link } from 'react-router-dom'
import './App.css';

function App() {
  return (
    <div>
      <nav>
        <Link to="/"> Home</Link> 
        <Link to="/about"> About</Link>
        <Link to="/playlist">Check out Playlist</Link>
      </nav>

    </div>
  );
}

export default App;
